import React from 'react'
function Show(props){
    console.log(props)
    let {name, color, readyToEat} = props.meat
    return(
        <div>
            <h1>Show</h1>
            <p>Name: {name}</p>
            <p>Color: {color}</p>
            <p>{readyToEat ? 'This meat is ready to eat' : 'This meat is not ready to eat.'}</p>
        </div>
    )
}
export default Show;

